Fe$_{2}$N can also be found in the \href{current_web_home_dir/AB_hP4_194_c_a-003}{$\eta$-Fe$_{2}$N/$\beta$-V$_{2}$N ($L'3_{2}$)} structure.  It has also been reported in the \href{current_web_home_dir/AB_hP4_194_c_a-003}{$L'3_{0}$ structure} 
 This structure has the same AFLOW label as \href{current_web_home_dir/A2B_oP12_60_d_c-003}{$\alpha$-PbO$_{2}$}, but in that case the lead site is only 49\% occupied, so that composition is actually closer to PbO$_{4}$. 
 The structures are generated by the same symmetry operations with different sets of parameters ({\tt --params}) specified in their corresponding CIF files.
